        return new Source("{% extends 'base.html.twig' %}

{% block title %}Modification{% endblock %}

{% block monTitre %}

    {% if isModification %}
        Modification {{aliment.nom}}
    {% else %}
        Ajout d'un nouvel élément
    {% endif %}

{% endblock %}

{% block body %}

{{form_start(form)}}
    <div class=\"row\">
        <div class=\"col-6\">
            {% if isModification %}
            <img src=\"{{asset('images/aliments/' ~ aliment.image )}}\" style=\"width:25%;\">
            {% endif %}
            <div>{{form_row(form.imageFile)}}</div>
            <div>{{form_row(form.nom, {\"attr\" : {'class' : 'text-danger'}, \"label\" : \"Nom de l'aliment\"})}}</div>
            <div>{{form_row(form.type)}}</div>
        </div>
        <div class=\"col-6\">
            {{form_widget(form)}}
        </div>
    </div>
    
    <input class=\"btn btn-primary\" type=\"submit\" value=\"Enregistrer\">

{{form_end(form)}}

{% endblock %}", "admin/admin_aliment/modifEtAjout.html.twig", "/Applications/MAMP/htdocs/aliments/templates/admin/admin_aliment/modifEtAjout.html.twig");
